window.bookSummaryJSON = "<p>Do you want to radically disrupt your mindset and think bigger? Do you feel it on your fingertips, just out of reach? Do you find yourself striving to break through the seams to success but just can’t push through the box you live in?</p> <p>The real you has an urge—and ability—to live in a much larger way. Transform your thoughts, your life, and your actions to achieve greatness … one thought at a time. This powerful audio program featuring top motivational speakers and thought leaders will teach you steps to increase confidence and motivation to reach your goals.</p> <p>In<i> Thinking Big</i>, Les Brown will infuse you with inspiration and a sense of empowerment so you can choose your future. Understand the link between motivation and accomplishment with Zig Ziglar. Be a student of Chris Widener and learn what is needed to influence others around you. Discover proven strategies to break through your limiting beliefs and achieve greatness with Dr. Larry Iverson.</p> <p>Don’t wait another day to change your thought process from a self-imposed limited one to one where your possibilities are boundless. Begin <i>Thinking Big</i> today!</p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying PDF will be available in your Audible Library along with the audio.</b></p>"; 
